import { gql } from "@apollo/client";

export const QUERY_USERS = gql`
  query allUsers {
      users {
        id
        username
        image
      }
    }
`;

export const QUERY_PROJECTS = gql`
  query all {
      users {
        id
        username
        image
      }
    }
`;
